import { useHistory } from 'react-router-dom';

const CakeCollection = ({ isAuth }: any) => {
  const history = useHistory();

  if (isAuth) {
    history.push('/signin');
  }

  return <div>CakeCollection</div>;
};

export default CakeCollection;
